description:
Goose - Whipass Remix (Extended) 128 kbps

This was encoded at MP3/320 because I didn't change the settings in Audacity, which I used to grab this track from SoundCloud. This was a non-downloadable track, so it was streamed at 128 kbps and that is evident in the quality. Still, the story behind the song and the talent of the composer made it worth getting, and this was the only source I could find. So be warned in advance, this is a departure from my standard of only ULing high-quality audio.  It's the best I could do in this case. What you have here is a 128 kbps quality song. All of that said, Enjoy!

Here's the story behind the song:
